import{preloadImages}from"../../libs/utils.js";function animateChessItems(){if($(".banner-expertise").length){var e=gsap.utils.toArray(".wrapper-chess .chess-item");gsap.set(e,{y:"120%"});let r=gsap.timeline({scrollTrigger:{trigger:".banner-expertise",start:"top top",end:"+=200%",scrub:!0,pin:!0}});e.forEach(e=>{r.to(e,{y:"0%",duration:.6,ease:"none"})})}}let init=()=>{gsap.registerPlugin(ScrollTrigger),animateChessItems(),ScrollTrigger.refresh()};preloadImages("img").then(()=>{init()}),$(window).on("beforeunload",function(){$(window).scrollTop(0)});